import React from "react";
import axios from "axios";

import styled from "styled-components";
import {
  Header,
  AppNameComponent,
  AppIcon,
  SearchComponent,
  SearchInput,
  SearchIcon,
} from "./components/header";

const Container = styled.div`
  display: flex;
  flex-direction: column;
`;

const RecipeList = styled.div`
  display: flex;
  flex-direction: row;
  padding: 30px;
  justify-content: space-evenly;
`;

const Recipes = styled.div`
  display: flex;
  flex-direction: column;
  padding: 10px;
  box-shadow: 0 3px 10px 0 #aaa;
`;

const RecipeImage = styled.div`
  height: 200px;
`;

const RecipeTitle = styled.div`
  font-size: 18px;
  font-weight: bold;
  color: black;
  margin: 10px 0;
`;

const App = () => {
  const APP_ID = "dd3ffea2";

  const APP_KEY = "b4b37afad59e070a14fd1b07d5fdccc3";

  const url = `https://api.edamam.com/api/recipes/v2?type=public&q=chicken&app_id=${APP_ID}&app_key=${APP_KEY}`;

  const getData = async () => {
    const result = await axios.get(url);

    console.log(result);
  };

  return (
    <Container>
      <Header>
        <AppNameComponent>
          <AppIcon src="hamburger.svg" />
          Recipe Finder
        </AppNameComponent>
        <SearchComponent>
          <SearchIcon src="/search-icon.svg" />
          <SearchInput placeholder="Search recipe..." />
        </SearchComponent>
      </Header>
      <RecipeList>
        <Recipes>
          <img />
          <span>test test test test test</span>
          <span>test test test test test</span>
          <span>test test test test test</span>
        </Recipes>
      </RecipeList>
    </Container>
  );
};

export default App;
